import {createReducer} from 'utils/reducerUtils'

const initialState = {
  fname:'',
  _id:'',
  loaded: 0,
  networks:[],
  netCount:0
}


function setUser(state, {user, networks,loaded=1,netCount}){
  if(networks === undefined)
  networks=[];
  return {
    ...state,
    ...user,
    networks:networks,
    loaded,
    netCount:netCount
  }
}



export default createReducer(initialState, {
  'SET_USER': setUser
})
